 const formatoF = styled.form`
 background-color: goldenrod;
 display: flex;
 flex-direction: column;`;
 const Form = ()=>{
    return(
        <formatoF>
            <label htmlFor="">
                username</label>
                <input type='text' name='username'></input> 
                <label htmlFor="">
                password</label>
                <input type='text' name='password'></input>    
                <button type='submit'>Login</button>         
        </formatoF>
    )
}
export default Form
